 ,

<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">A mechanism for the synergistic antimalarial action of atovaquone and proguanil . A combination of atovaquone and proguanil has been found to be quite effective in treating malaria , with little evidence of the emergence of resistance when atovaquone was used as a single agent . We have examined possible mechanisms for the synergy between these two drugs . While proguanil by itself had no effect on electron transport or mitochondrial membrane potential ( DeltaPsim ) , it significantly enhanced the ability of atovaquone to collapse DeltaPsim when used in combination . This enhancement was observed at pharmacologically achievable doses . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01131
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 acted as a biguanide rather than as its metabolite cycloguanil ( a parasite dihydrofolate reductase [ 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ] inhibitor ) to enhance the atovaquone effect ; another 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitor , pyrimethamine , also had no enhancing effect . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01131
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 - mediated enhancement was specific for atovaquone , since the effects of other mitochondrial electron transport inhibitors , such as myxothiazole and antimycin , were not altered by inclusion of proguanil . Surprisingly , proguanil did not enhance the ability of atovaquone to inhibit mitochondrial electron transport in malaria parasites . These results suggest that proguanil in its prodrug form acts in synergy with atovaquone by lowering the effective concentration at which atovaquone collapses DeltaPsim in malaria parasites . This could explain the paradoxical success of the atovaquone-proguanil combination even in regions where proguanil alone is ineffective due to resistance . The results also suggest that the atovaquone-proguanil combination may act as a site-specific uncoupler of parasite mitochondria in a selective manner .</div>
